		["Frenzy Tracker v2"] = {
			["sparkWidth"] = 10,
			["sparkOffsetX"] = 0,
			["xOffset"] = 0,
			["preferToUpdate"] = false,
			["customText"] = "\n",
			["yOffset"] = -324.1107788085938,
			["anchorPoint"] = "CENTER",
			["sparkRotation"] = 0,
			["sparkRotationMode"] = "AUTO",
			["url"] = "https://wago.io/FrenzyTracker/20",
			["actions"] = {
				["start"] = {
					["custom"] = "if aura_env.state.type == \"cooldown\" then\n    local a = aura_env.config.anchor\n    local anchor = a == 1 and \"TOPLEFT\" or \"BOTTOMRIGHT\" \n    aura_env.region:SetAnchor(anchor,aura_env.baseRegion.bar, anchor)\n    aura_env.region:SetOffset(0,0)\n    aura_env.region:SetFrameLevel(aura_env.baseRegion:GetFrameLevel()+1)\n    if aura_env.orientation == 1 then\n        aura_env.region:SetRegionWidth(aura_env.baseRegion.bar:GetWidth())\n    else\n        aura_env.region:SetRegionHeight(aura_env.baseRegion.bar:GetHeight())\n    end\n    aura_env.region:SetParent(aura_env.baseRegion)\nend\n\n\n",
					["do_custom"] = true,
				},
				["finish"] = {
				},
				["click"] = {
				},
				["init"] = {
					["custom"] = "aura_env.frenzyDuration = 8\naura_env.cdSpell = 217200\nWeakAuras.WatchSpellCooldown(aura_env.cdSpell)\naura_env.baseRegion = aura_env.region\naura_env.orientation = aura_env.region.orientation:find(\"VERTICAL\") and 2 or 1\nlocal r = aura_env.region\nlocal b = r.bar\nWeakAuras.WatchGCD()\n\n-- Set up a bunch of values that vary based on the selected bar orientation, allowing the Aura to automatically adjust to horizontal/vertical\nlocal orientation = r.orientation\nlocal orientationType = orientation:find(\"HORIZONTAL\") and 1 or 2\nlocal orientationDirection = orientation:find(\"INVERSE\") and 2 or 1\nlocal point1, point2, point3, barLength, barWidth, offsetAdjustment\nif orientation == \"HORIZONTAL_INVERSE\" then\n    point1, point2, point3, barLength, barWidth, offsetAdjustment = \"TOPLEFT\", \"BOTTOMLEFT\", \"RIGHT\", b.totalWidth - b.iconWidth, b.totalHeight, 1\nelseif orientation == \"HORIZONTAL\" then\n    point1, point2, point3, barLength, barWidth, offsetAdjustment = \"TOPRIGHT\", \"BOTTOMRIGHT\", \"LEFT\",  b.totalWidth - b.iconWidth, b.totalHeight, -1\nelseif orientation == \"VERTICAL\" then\n    point1, point2, point3, barLength, barWidth, offsetAdjustment = \"BOTTOMLEFT\", \"BOTTOMRIGHT\", \"TOP\", b.totalHeight - b.iconHeight, b.totalWidth, 1\nelseif orientation == \"VERTICAL_INVERSE\" then\n    point1, point2, point3, barLength, barWidth, offsetAdjustment = \"TOPLEFT\", \"TOPRIGHT\", \"BOTTOM\", b.totalHeight - b.iconHeight, b.totalWidth, -1\nend\n-- Set up the tick pool and create frames\nif not b.tickPool then\n    b.tickFrame = CreateFrame(\"FRAME\", nil, b)\n    b.tickFrame:SetClipsChildren(true)\n    b.tickPool = CreateTexturePool(b.tickFrame, \"ARTWORK\",7,nil) \n    b.tickFrame.currentCast = b.tickFrame:CreateTexture(nil, \"OVERLAY\", 7)\nend\nlocal currentCast = b.tickFrame.currentCast\nlocal tickFrame = b.tickFrame\ntickFrame:ClearAllPoints()\ntickFrame:SetAllPoints(b)\nb.tickPool:ReleaseAll()\n\nlocal tickWidth, tickTexture, tickR, tickG, tickB, tickA = aura_env.config.tickWidth, aura_env.config.tickTexture, unpack(aura_env.config.tickCol)\nlocal Acquire = function()\n    local tick = b.tickPool:Acquire()\n    tick:SetDrawLayer(\"ARTWORK\", 3);\n    if tickTexture and tickTexture ~= \"\" then\n        tick:SetTexture(tickTexture)\n        tick:SetVertexColor(tickR, tickG, tickB, tickA)\n    else\n        tick:SetColorTexture(tickR, tickG, tickB, tickA)\n        tick:SetVertexColor(tickR, tickG, tickB, tickA)\n    end\n    tick:SetWidth(orientationType == 1 and tickWidth or barWidth)\n    tick:SetHeight(orientationType == 1 and barWidth or tickWidth)\n    return tick\nend\nif aura_env.config.castTexture and aura_env.config.castTexture ~= \"\" then\n    currentCast:SetTexture(aura_env.config.castTexture)\n    currentCast:SetVertexColor(unpack(aura_env.config.castCol))\nelse \n    currentCast:SetColorTexture(unpack(aura_env.config.castCol))\n    currentCast:SetVertexColor(unpack(aura_env.config.castCol))\nend\ncurrentCast.SetCastSize = orientationType == 1 and currentCast.SetWidth or currentCast.SetHeight \ncurrentCast:SetCastSize(1)\ncurrentCast:ClearAllPoints()\ncurrentCast:SetPoint(point1, b.fg)\ncurrentCast:SetPoint(point2, b.fg)\n-- Create a function that will be fired every frame while there's a current cast/gcd to display\nlocal exp\nlocal castUpdate = function()\n    if exp and exp > GetTime() and r.currentMax and r.currentMax > 0 then\n        local size = (exp-GetTime()) * (barLength/r.currentMax)\n        currentCast:SetCastSize(size)\n    else \n        tickFrame:SetScript(\"OnUpdate\", nil)\n        currentCast:SetCastSize(1)\n        currentCast:Hide()\n        exp = nil\n    end\nend\n--Create a function to be fired when the current cast/GCD starts/ends to start the castUpdate running and create ticks.  \nlocal SetMarkers \nlocal tickSetting, tickValue = aura_env.config.tickSetting, aura_env.config.tickValue\nSetMarkers = function()\n    if r.currentMax and r.currentMax > 0 then\n        exp = select(5,WeakAuras.UnitCastingInfo(\"player\"))\n        if not exp then\n            exp = select(5,WeakAuras.UnitChannelInfo(\"player\"))\n        end\n        if exp then\n            exp = exp/1000\n        else\n            exp = select(2,WeakAuras.GetGCDInfo()) \n            if exp == math.huge then exp = nil end\n        end\n        if exp then\n            tickFrame:SetScript(\"OnUpdate\", castUpdate)\n            currentCast:Show()\n        else \n            tickFrame:SetScript(\"OnUpdate\", nil)\n            currentCast:SetCastSize(1)\n            currentCast:Hide()\n        end\n        b.tickPool:ReleaseAll()\n        local gcd\n        if tickSetting == 3 and tickValue > 0 then\n            gcd = tickValue\n        elseif tickSetting == 2 and GetSpellInfo(tickValue) then\n            gcd = select(4, GetSpellInfo(tickValue))/1000\n        else\n            gcd = WeakAuras.CalculatedGcdDuration()\n        end\n        local tickCount = floor(r.currentMax/gcd)\n        for i = 1, tickCount do\n            local tick = Acquire()\n            tick:SetAlpha(1 - (i / (tickCount+1)))\n            tick:ClearAllPoints()\n            local offset = offsetAdjustment * ((gcd * i)*(barLength/r.currentMax))\n            tick:SetPoint(\"CENTER\", currentCast, point3, orientationType == 1 and offset or 0, orientationType == 2 and offset or 0)\n            tick:Show()\n        end\n    end\nend\n\ntickFrame:RegisterUnitEvent(\"UNIT_SPELLCAST_START\", \"player\")\ntickFrame:RegisterUnitEvent(\"UNIT_SPELLCAST_STOP\", \"player\")\ntickFrame:RegisterUnitEvent(\"UNIT_SPELLCAST_CHANNEL_START\", \"player\")\ntickFrame:RegisterUnitEvent(\"UNIT_SPELLCAST_CHANNEL_STOP\", \"player\")\ntickFrame:RegisterUnitEvent(\"UNIT_SPELLCAST_DELAYED\", \"player\")\ntickFrame:RegisterUnitEvent(\"UNIT_SPELLCAST_CHANNEL_UPDATE\", \"player\")\ntickFrame:RegisterEvent(\"SPELL_UPDATE_COOLDOWN\")\ntickFrame:SetScript(\"OnEvent\", SetMarkers)\nhooksecurefunc(b, \"Update\", SetMarkers)",
